If you haven't already, you'll need to install Rust and set up your development environment. You can follow the instructions on the official Rust website to get started: <https://www.rust-lang.org/tools/install>

2. Create a new Rust project:

Once you have Rust installed, you can create a new Rust project using the `cargo new` command. For example, you can run the following command to create a new project called `clipboard-tts`:
```csharp
cargo new clipboard-tts
```
3. Add dependencies:

You'll need to add a few dependencies to your Rust project to support the ElevenLabs API and TTS. You can add dependencies to your project by editing the `Cargo.toml` file in the root of your project.

To support the ElevenLabs API, you can add the `reqwest` and `serde` dependencies. `reqwest` is a HTTP client library that you can use to make API requests, and `serde` is a serialization library that you can use to parse JSON responses.

To support TTS, you can add the `tts` dependency. `tts` is a Rust library that provides a simple interface for text-to-speech conversion.

Here's an example `Cargo.toml` file that includes these dependencies:
